LEGO - Brick Suit Guy - Minifigür Series 18: Party 71021 - 2 
Bir "Lego" Minifigür 3-7 adet parçadan oluşur. Boyutları 5 cm' dir.Kollar, eller, bacaklar, kafa hareket edebilir.Vücut, bacaklar, kafa, saç ve tüm aksesuarlar takılıp çıkarılabilir, başka "Lego" Minifigürlere de takılabilir.Görselde bulunan model gönderilir.

Lego Family Seyahat Anıları 41838
Seyahat Anıları (41838) oyuncak yapım setiyle 14 yaş ve üzeri çocuklar dahil ailece yaratıcı bir yapım etkinliği sizi bekliyor. Macerayı seven gezginler ve aileler için eğlenceli bir hediye olan bu yaratıcı LEGO® oyun setinde inşa edilebilen bir dünya haritası, bir jet, 4 mikro model araç, 20 konum karosu, 10 fotoğraf tutucu ve 5 yapım talimatı kitapçığı bulunur. Aileler, Wonderliner jetini ve haritayı inşa ederken en sevdikleri seyahat anılarını paylaşabilir veya yeni geziler hayal edebilir. Sonra haritayı ziyaret edilen ülkeleri veya planlanan gezileri gösterecek şekilde ayarlayabilir ve her macerada değiştirebilirler! Bu LEGO seyahat oyun seti, yaratıcı eğlenceyi genişletmek için anlamlı ve anılarla dolu bir hediye ya da ailece bir tatil etkinliğidir. Ayrıca birlikte model yapmanıza, modelinizi 3 boyutlu yakınlaştırmanıza ve döndürmenize, ilerlemenizi takip etmenize ve setleri tek bir yerden kaydetmenize olanak tanıyan EGO Builder uygulamasıyla siz ve çocuklarınız, setlerinizi en iyi şekilde kullanabilirsiniz.;

Grup eğlencesi için seyahat anıları seti – Bir dünya haritası ve parçalarla inşa edilebilen jet içeren Seyahat Anları yapım setiyle ailece yapım aktivitelerini teşvik edin ya da bir sonraki maceranızı planlayın;
Dünya haritası oyuncağı – Bu ailece model yapım seti, 4 bölümden oluşan bir dünya haritası yapmak için 1231 parça ve 5 ayrı talimat, inşa edilebilen bir jet, 4 mikro araç modeli, fotoğraf tutucular ve daha fazlasını içerir;
Aile boyu aktivite – Harita oyun seti, yakın zamanda yapılan bir seyahati göstermek, heyecan verici yeni olasılıkları planlamak veya yeni seyahat maceralarına ilham vermek için istendiği zaman değiştirilebilir;
Oyuncak yapım seti – Harita ve jet bittiğinde aileler, dekoratif ve konum belirten karoları, mikro araçları ve fotoğraf tutucuları kullanarak seti defalarca kişiselleştirebilir;
Gezginler için hediye – Bu aile aktivitesi hediyesiyle aileler ve 14 yaş ve üzeri çocuklar, ailece yaratıcı zaman geçirmek istedikleri her zaman birlikte unutulmaz anlar yaratabilirler;
3 boyutlu yapım talimatları – Çocuklarınızla birlikte model inşa edebileceğiniz, setleri kaydedebileceğiniz, ilerlemeyi takip edebileceğiniz, modelinizi 3 boyutlu yakınlaştırıp döndürebileceğiniz LEGO® Builder uygulamasıyla yepyeni bir şekilde model inşa edin.;
Yapım seti serisi – Bir LEGO® setini açtığınızda herkesi yaratıcı olmaya ve oynamaya davet edersiniz, öyleyse ailenizi, arkadaşlarınızı, kuzenlerinizi veya iş arkadaşlarınızı toplayın. Bu setler, yaratıcı yönünüzü birlikte ifade etmek için mükemmel bir fırsattır;
Boyutlar – 1231 parçalı setteki uçaklı ve fotoğraf tutuculu dünya haritası oyuncağının yüksekliği 14 cm, genişliği 49 cm, derinliği 31 cm’dir;
;

Lego Ninjago Lloyd ve Arin'in Ninja Ekibi Robotları 71794
9 yaş ve üzeri çocuklar, Lloyd ve Arin'in Ninja Ekibi Robotları (71794) ile NINJAGO® Ejderhalar Yükseliyor TV dizisinden nefes kesen eğitim ve savaş sahnelerini canlandırabilir. Daha önce görülmemiş bu yapım setinde ninja ustası Lloyd’un ve öğrencisi Arin’in hareket edebilen robotları, daha büyük tek bir robot halinde birleşerek sınırsız oyun olanağı sunar. Efsanevi savaşlar için 5 minifigür Bu robot oyun setinde 5 minifigür bulunur. Ninja ustası Lloyd’un 2 katanası, ninja öğrencisi Arin’in2 katanası ve bir yakalama çengeli vardır. İmperium kılıçlı Rapton, asalı İmperium Muhafız Komutanı ve İmperium kılıçlı İmperium Pençe Generalinden oluşan kötü üçlüye karşı savaşırlar. Bu set, çocuklara sınırsız aksiyon dolu çatışma için ihtiyaçları olan her şeyi sunar. LEGO® Builder uygulaması LEGO Builder uygulaması, kolay ve sezgisel yapım macerasında size ve çocuğunuza yol gösterir. Modelleri 3 boyutlu olarak yakınlaştırın ve döndürün, setleri kaydedin ve ilerlemenizi takip edin.;

Benzersiz 2 robotlu oyun seti – 9 yaş ve üzeri ninja hayranları, Lloyd ve Arin'in Ninja Ekibi Robotları (71794) ile NINJAGO® Ejderhalar Yükseliyor TV dizisinden eğitim ve savaş sahnelerini canlandırabilir;
5 minifigür – Bu ninja oyun setinde ninja ustası Lloyd ve öğrencisi Arin’in minifigürleri, Rapton, İmperium Muhafız Komutanı ve İmperium Pençe Generali minifigürlerine karşı savaşabilir;
2 hareketli robotu birleştirin – İlk kez çocuklar, Arin’in robotunu Lloyd’un robotunun göğsüne takarak 2 robotu birleştirip daha büyük ve daha ağır silahlı bir robot oluşturabilir;
Daha fazla ninja aksiyonu – Sora’nın Dönüşen Robot Motosiklet Yarışçısı (71792), Ejderha Enerji Özleri Tapınağı (71795) ve LEGO® NINJAGO® serisindeki diğer setlere de göz atın;
İnşa edin ve oynayın – Bu 764 parçalı oyun setiyle sıkı ninja hayranları, eğlenceli bir yapım deneyiminden sonra kötülüğün güçlerini yenebilir. Bu set, doğum günü hediyesi ya da günlük bir hediye olarak verilebilir;
Sergileme modeli – Birleştirilmiş robotların boyu 28 cm’dir ve savaş oyunları arasında çocukların odalarında sergilenebilir;
Model yapmanın yeni bir yolu – LEGO® Builder uygulaması, çocuklara sezgisel yapım yolculuğunda yol gösterir. Setleri kaydedebilir, ilerlemelerini takip edebilir ve modelleri yaparken 3 boyutlu olarak yakınlaştırabilir ve döndürebilirler;
Birinci kalite – Altmış yılı aşkın süredir LEGO® yapım parçaları, her seferinde tutarlı olarak takılacak şekilde üretilmektedir;
Her zaman güvenli ellerde – LEGO® yapım parçaları, katı global güvenlik standartlarına uygundur;
